import Link from "next/link";
import styles from "./Button.module.css";

function Nav() {
    return (
        <ul>
            <li>
                <Link href="/">
                    <a>Home</a>
                </Link>
            </li>
            <li>
                <Link href="/about">
                    <a>About</a>
                </Link>
            </li>
        </ul>
    );
}

export default Nav;
